import React, { Component} from 'react';
import './style.css'

class Pokemons extends Component {
    constructor(props) {
        super(props);
        this.state = {
            pokemons: {},
        };
    }

    componentDidMount() {
        this.fetchListPokemonId()
    }

    fetchListPokemonId()
    {
        fetch(`http://localhost:4242/pokemons/001`)
            .then(res => res.json())
            .then(res =>
            {
                console.log(res);
            })
    }


}
export default Pokemons;
